,('2230', @EdOrgId, 'AP African American Studies', 1,'22','AP African American Studies is an interdisciplinary course that examines the diversity of African American experiences by exploring authentic and varied sources. Students explore key topics that extend from early African kingdoms to the ongoing challenges and achievements of the contemporary moment. This course foregrounds a study of the diversity of Black communities in the United States within the broader context of Africa and the African diaspora. This course is intended to prepare students for the optional Advanced Placement Exam in the subject and should follow the published College Board guidelines.')
,('2240', @EdOrgId, 'Capstone in Community I', 1,'22','This course enables students to design a project rooted in authentic contexts and build on local assets and culture. Students engage in active, self-directed, and community-based learning experiences to produce a body of work, resulting in public exhibitions of learning to school, family, and community. Students will develop community-defined skills, as well as critical thinking, resilience, problem-solving, time-management, integrity, community-mindedness, communication, and collaboration.')
,('2241', @EdOrgId, 'Capstone in Community II', 1,'22','This course enables students to extend a project rooted in authentic contexts and build on local assets and culture. Students engage in community-based research, active and self-directed learning experiences to produce a community-based solution that results in public exhibitions of learning to school, family, and community. Students will learn ethical research practices, develop community-defined skills, as well as critical thinking, resilience, problem-solving, time-management, integrity, community-mindedness, communication, and collaboration.')
