,('1688', @EdOrgId, 'Energy and Power -Generation and Distribution', 1,'29','This course explores the energy industrys economic effects and innovations related to reducing negative environmental impacts and providing consumer benefits. Students complete projects on efficiently using integrated energy systems by connecting non-renewable, renewable, and inexhaustible resources. While completing projects, students consider critical health, safety, and environmental regulations as they analyze waste disposal, clean-up methods, and national environmental priorities. Other key technical concepts include transportation and distribution systems, the application of circuits, and industry-related scientific laws. Students relate specific requirements for entry into postsecondary and employment in the Energy and Natural Resource Management field to their interests and available opportunities (ENRM course 2).')
,('1689', @EdOrgId, 'Applications of Integrated Energy Systems', 1,'29','In this course, students analyze and apply advanced components of the integrated energy system to advance their understanding of new and emerging solutions to conserve resources and safeguard the environment. Students apply critical concepts of hydraulics, pneumatics, cylinder circuits, and automation. Students interpret and use electrical, instrumentation, and control systems. Students collaborate to create drawings and schematics, assemble, test, troubleshoot, and improve existing components of the integrated system. While completing the projects, students apply their expanding knowledge and practices of health, safety, and environmental regulations and laws (ENRM course 3).')
,('1690', @EdOrgId, 'Energy and Natural Res Mgt Practicum and Adv Applications', 1,'29','In this capstone course, students apply the knowledge and skills obtained in the Energy and Natural Resource Management program to field-based experiences to prepare for ENRM occupations. Students enhance their ENRM understanding by creating relevant workplace plans that analyze a unique problem found in the workplace and highlight needed health, safety, and environmental practices. Within this plan, students develop a viable solution for the field, such as an alternative solution or enhancement to the existing integrated energy system. Particular topics include analyzing testing implications, related waste disposal solutions, economic and environmental benefits and concerns, and regional regulations for the selected solutions (ENRM course 4).')
