,('0582', @EdOrgId, 'GRADS-Fatherhood', 1,'11','GRADS - Fatherhood - Recommended for Students Grades 9 - 12 - Course addresses legal issues, fosters bonding and healthy relationships, addresses both child development and parenting skills, employability skills, staying in school, managing a budget, decision making, goal setting, and fosters positive outcomes for the child. Course can provide classroom instruction to traditional students as a preventative measure.  Case Management (building and connecting to community resources) is an integral part of this course.  MUST BE A GRADS RECOGNIZED SITE IN ORDER TO COUNT STUDENTS IN THIS COURSE.')
,('0583', @EdOrgId, 'GRADS-Independent Living', 1,'11','GRADS - Independent Living - Recommended for Students Grades 9 - 12 - A course designed for parenting youth with pre-school age children.  Topics may include:  Living on your own, budgeting, checking accounts, savings, taxes, job security and advancement, continuing education, balancing work and family, economic independence, reading and language development, parent-child interaction, Child development of pre-school children, discipline, child abuse, and sexual transmitted diseases.  Case Management (building and connecting to community resources) is an integral part of this course. MUST BE A GRADS RECOGNIZED SITE IN ORDER TO COUNT STUDENTS IN THIS COURSE.')
