AS CourseList (
	 [CourseCode]
	,[EdOrgId]
	,[CourseTitle]
	,[IntValue1]
	,[CodeValue1]
	,[CourseDescription]
)

WHILE(@Cnt <= (SELECT COUNT(*) FROM #Temp_Course_Val))
BEGIN

	SELECT 
		 @CourseCode  			= [CourseCode]
		,@EdOrgId				= [EdOrgId]
		,@CourseTitle 			= [CourseTitle]
		,@IntValue1 			= [IntValue1]
		,@CodeValue1 			= [CodeValue1]
		,@CourseDesc  			= REPLACE([CourseDescription], '''','''''')
	FROM #Temp_Course_Val
	WHERE [AutoKey] = @Cnt;

	SET @DynSQL = 
		'INSERT INTO [edfi].[Course]( 
			 [CourseCode] 
			,[EducationOrganizationId]
			,[CourseTitle] 
			,[NumberOfParts] 
			,[AcademicSubjectDescriptorId] 
			,[CourseDescription] 
			,[CreateDate]
			,[LastModifiedDate]
		)VALUES( 
			  ''' + @CourseCode  + ''' 
			, ' + CAST(@EdOrgId AS NVARCHAR(10))   + '
			, ''' + @CourseTitle  + ''' 
			, ' + CAST(@IntValue1 AS NVARCHAR(10))   + '
			, (' + @DynSQL_Sel + ' AND [Namespace] = ''' + @CodeType_2 + ''' AND [CodeValue] = ''' + @CodeValue1 + ''') 
			, ''' + @CourseDesc  + ''' 
			, GETDATE(), GETDATE()	
		);'

	EXEC(@DynSQL);

	SET @Cnt += 1;

END

SET @Cnt = 1;

DROP TABLE IF EXISTS #Temp_Course_Val;

